class Solution:
    def findLatestStep(self, arr: List[int], m: int) -> int:
        mLenOnes = [0]
        intervalLengthMap = defaultdict(int)
        intervalLengthMap[m] = 0
        intervals = [[0, -1]] * (len(arr)+2)

        for n in arr:
            intervals[n] = [n, n]
            # connect to left?
            start = end = 0
            if intervals[n-1][1]+1 == n:
                # merge left, the left interval disappears
                leftS, leftE = intervals[n-1]
                intervalLengthMap[leftE-leftS+1] -= 1
                start = intervals[n-1][0]
                end = n
                intervals[start][1] = end
                intervals[end][0] = start

            # connect to right
            if intervals[n+1][0]-1 == n:
                # right interval disappears
                rightS, rightE = intervals[n+1]
                intervalLengthMap[rightE-rightS+1] -= 1
                start = intervals[n][0]
                end = intervals[n+1][1]
                intervals[start][1] = end
                intervals[end][0] = start

            intervalLengthMap[end-start+1] += 1
            mLenOnes.append(1 if intervalLengthMap[m] else 0)

        prefixSums = list(itertools.accumulate(mLenOnes))
        idx = bisect.bisect_left(prefixSums, prefixSums[-1])
        if idx:
            return idx

        return -1


