class Solution:
    def findLatestStep(self, arr: List[int], m: int) -> int:
        n = len(arr)
        if m==n:
            return n

        ones = [1,n]
        res = n
        for num in arr[::-1]:
            idx = bisect.bisect_left(ones, num)

            newWindLen = []
            if idx%2==0:
                # it happen to fall at the start of an interval
                # remove this point only 
                newWindLen.append(ones[idx+1] - ones[idx] + 1 - 1)
                # ones = ones[:idx] + [num+1] + ones[idx+1:]
                ones[idx] = num+1
                
            else:
                # two cases
                if ones[idx] == num:
                    # happen to be the end of an interval 
                    newWindLen.append(ones[idx] - ones[idx-1] + 1 - 1)
                    # ones = ones[:idx] + [num-1] + ones[idx+1:]
                    ones[idx] = num-1
                else:
                    # it is in between 
                    left = ones[idx-1]
                    right = ones[idx]
                    ones[idx-1:idx+1] = [left, num-1, num+1, right]
                    # equal to 
                    # ones[idx:idx] = [num-1, num+1]
                    # newWindLen.extend([num-1-left+1, right-num-1+1])
                    newWindLen.extend([num-left, right-num])
            res -= 1
            if m in newWindLen:
                return res

        return -1


